import React, { useState } from "react";
import styled from "styled-components";
import { motion } from "framer-motion";
import { attractions } from "../data/attractions";
import { Star, MapPin, CalendarDays } from "lucide-react";

const categories = ["Alle", "Historisk", "Festival", "Natur", "Museum"];

const PageWrapper = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 4rem 1rem;
`;

const Filters = styled.div`
  display: flex;
  gap: 1rem;
  justify-content: center;
  margin-bottom: 3rem;
  flex-wrap: wrap;
`;

const FilterButton = styled.button`
  padding: 0.5rem 1rem;
  border: none;
  background: ${({ active }) => (active ? "#2563eb" : "#f3f4f6")};
  color: ${({ active }) => (active ? "white" : "#1f2937")};
  font-weight: 600;
  border-radius: 9999px;
  cursor: pointer;
  transition: background 0.3s;

  &:hover {
    background: #2563eb;
    color: white;
  }
`;

const Grid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
  gap: 2rem;
`;

const Card = styled(motion.div)`
  background: white;
  border-radius: 1rem;
  overflow: hidden;
  box-shadow: 0 4px 20px rgba(0, 0, 0, 0.05);
  transition: transform 0.3s ease;

  &:hover {
    transform: translateY(-5px);
  }
`;

const Image = styled.img`
  width: 100%;
  height: 180px;
  object-fit: cover;
`;

const CardContent = styled.div`
  padding: 1.25rem;
`;

const Badge = styled.span`
  display: inline-block;
  background: #ede9fe;
  color: #7c3aed;
  font-size: 0.75rem;
  padding: 0.25rem 0.5rem;
  border-radius: 9999px;
  margin-bottom: 0.75rem;
`;

const Title = styled.h3`
  font-size: 1.125rem;
  font-weight: 600;
  margin-bottom: 0.25rem;
`;

const Description = styled.p`
  font-size: 0.875rem;
  color: #4b5563;
  margin-bottom: 1rem;
`;

const InfoLine = styled.div`
  display: flex;
  align-items: center;
  gap: 0.5rem;
  font-size: 0.875rem;
  color: #6b7280;
  margin-bottom: 0.5rem;
`;

const Highlights = styled.ul`
  font-size: 0.875rem;
  color: #4b5563;
  margin-bottom: 1rem;
  padding-left: 1rem;
  list-style-type: disc;
`;

const Button = styled.button`
  background: #2563eb;
  color: white;
  border: none;
  padding: 0.5rem 1rem;
  border-radius: 0.5rem;
  font-size: 0.875rem;
  font-weight: 600;
  cursor: pointer;
  width: 100%;
  transition: background 0.3s;

  &:hover {
    background: #1d4ed8;
  }
`;

const Rating = styled.div`
  display: flex;
  align-items: center;
  gap: 0.25rem;
  font-size: 0.875rem;
  font-weight: 600;
  color: #f59e0b;
  margin-bottom: 0.5rem;
`;

const AttractionsPage = () => {
  const [selected, setSelected] = useState("Alle");

  const filtered =
    selected === "Alle"
      ? attractions
      : attractions.filter((a) => a.category === selected);

  return (
    <PageWrapper>
      <Filters>
        {categories.map((cat) => (
          <FilterButton
            key={cat}
            active={selected === cat}
            onClick={() => setSelected(cat)}
          >
            {cat}
          </FilterButton>
        ))}
      </Filters>

      <Grid>
        {filtered.map((item, i) => (
          <Card
            key={item.id}
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.4, delay: i * 0.1 }}
          >
            <Image src={item.imageUrl} alt={item.title} />
            <CardContent>
              <Badge>{item.category}</Badge>
              <Rating>
                <Star size={16} /> {item.rating}{" "}
                <span style={{ color: "#6b7280" }}>({item.reviews})</span>
              </Rating>
              <Title>{item.title}</Title>
              <Description>{item.description}</Description>
              <InfoLine>
                <MapPin size={16} /> {item.location}
              </InfoLine>
              <InfoLine>
                <CalendarDays size={16} /> {item.period}
              </InfoLine>
              <Highlights>
                {item.highlights.map((point, index) => (
                  <li key={index}>{point}</li>
                ))}
              </Highlights>
              <Button>Mer informasjon</Button>
            </CardContent>
          </Card>
        ))}
      </Grid>
    </PageWrapper>
  );
};

export default AttractionsPage;
